import {useState} from 'react';
import './select.css';


function SelectPage(){
    const [images, setImage] = useState([]);
    let sentence;
    let myName

    let oneList = [
        "https://w7.pngwing.com/pngs/210/306/png-transparent-face-with-tears-of-joy-emoji-crying-laughter-sticker-sad-emoji-pic-crying-emoji-icon-smiley-infant-anger.png", "https://i.pinimg.com/originals/da/8c/21/da8c2163061be58d770f6f9af78258e8.png"
    ]
    let twoList = [
        "https://hotemoji.com/images/dl/x/sad-emoji-by-google.png","https://p7.hiclipart.com/preview/958/275/752/pile-of-poo-emoji-sadness-emoticon-sad-emoji.jpg"
    ]

    let threeList = [
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQs4bO4DI5Cqr6OTMOhQfJMlIrO18_HBInvog&usqp=CAU", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQrYGN-7gigJsQtG4cP7wAE8B0gLDnPXi_KOQ&usqp=CAU"
    ]
    let fourList = [
        "data:image/jpeg;base64,", "data:image/jpeg;base64,"
    ]

    let fiveList = [
"data:image/jpeg;base64,", "https://cdn.shopify.com/s/files/1/1061/1924/files/Hugging_Face_Emoji_2028ce8b-c213-4d45-94aa-21e1a0842b4d_large.png?15202324258887420558"
    ]

    let sixList = [
        "data:image/jpeg;base64,", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRljAZylZyoTb2darIIAk9BpGCk6GChbsjwEw&usqp=CAU"
    ]

    let sevenList = [
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRxGJFA1AmNjYMIp2sW1jbMPbWHjYj1Ee9tKA&usqp=CAU", "data:image/jpeg;base64,"
    ]

    let eightList = [
        "data:image/jpeg;base64,"
    , "data:image/jpeg;base64,"
    ]

    let nineList = [
        "data:image/jpeg;base64,"
    , "data:image/jpeg;base64,"
]

    let tenList = [
        "data:image/jpeg;base64,"
       , "data:image/jpeg;base64,"
    ]
    
    
    return(
        <div>
    <h2> Expressions for Feelings</h2>
  
    <button id='one' onClick = {Pictures} > 1 </button>
    <button id='two' onClick = {Pictures} > 2 </button>
    <button id='three' onClick = {Pictures}> 3 </button>
    <button id='four' onClick = {Pictures}> 4 </button>
    <button id='five' onClick = {Pictures}> 5 </button>
    <button id='six' onClick = {Pictures}> 6 </button>
    <button id='seven' onClick = {Pictures}> 7 </button>
    <button id='eight' onClick = {Pictures}> 8 </button>
    <button id='nine' onClick = {Pictures}> 9 </button>
    <button id='ten' onClick = {Pictures}> 10 </button>

    <h2> Emojis</h2>
    <div>
        {images.map((image, index)=>{
            return <img className="picture" src={image} key={index} alt="hello"/>
        })}
        <input/>
    </div> 
    <h2> Sentences</h2>
    <input id= 'input' type='text' placeholder='Add a sentence'></input>
    <input type='submit' onClick = {handleSubmit}></input>
    </div>
    )

   function Pictures(e){
        {
            if (e.target.id === 'one') {
                setImage((images, oneList))
            }

            if (e.target.id === 'two'){
                setImage((images, twoList))
            }

            if (e.target.id === 'three'){
                setImage((images, threeList))
            }
            if (e.target.id === 'four'){
                setImage((images, fourList))
            }
            if (e.target.id === 'five'){
                setImage((images, fiveList))
            }
            if (e.target.id === 'six'){
                setImage((images, sixList))
            }
            if (e.target.id === 'seven'){
                setImage((images, sevenList))
            }
            if (e.target.id === 'eight'){
                setImage((images, eightList))
            }
            if (e.target.id === 'nine'){
                setImage((images, nineList))
            }
            if (e.target.id === 'ten'){
                setImage((images, tenList))
            }
        }

    }
    function handleSubmit (){
        myName = "me"
        sentence = document.getElementById('input').value
        console.log (images, sentence)
        localStorage.setItem(myName, [sentence, images])
    }

}
export default SelectPage


